import React from 'react';
import Data from "./Data";
import Card from './Card';
function App(){
    const Da=Data.map((el)=>{
        <Card img={el.img}
        title={el.title}
        review={el.review}

        />
    })
    return(
        <div>{Da}</div>
    )

}
export default App
